rulesList.cssText:
@media (max-width: 600px) {
  .ratings-padding { text-align: left; display: block; padding: 0px 8px; }
  .ratings-padding label, .ratings-padding label.matrix-label { display: unset; }
  .seek-ratings .seek-input { display: unset; align-items: unset; justify-content: unset; }
  .seek-ui.seek-ratings .field .radio { margin-top: unset; margin-bottom: unset; }
  .seek-ratings--matrix .seek-inst { display: none; }
}

@media (min-width: 512px) {
  div[role="region"].page-notice, section.page-notice { margin: var(--spacing-200) 0; }
  .page-notice__title { margin-bottom: 2px; }
  p.page-notice__cta { grid-area: 1 / 4; justify-self: flex-end; margin-top: 1px; padding-right: var(--spacing-200); }
  .page-notice__footer { justify-self: flex-end; margin-top: 0px; }
}

@media (prefers-reduced-motion) {
  .lightbox-dialog--hide.lightbox-dialog--mask-fade, .lightbox-dialog--hide.lightbox-dialog--mask-fade-slow { transition: background-color var(--motion-duration-short-3) var(--motion-easing-soft-exit); }
  .lightbox-dialog--hide .lightbox-dialog__window--animate, .lightbox-dialog--hide .lightbox-dialog__window--fade { transition: opacity var(--motion-duration-short-3) var(--motion-easing-soft-exit); }
  .lightbox-dialog--hide .lightbox-dialog__window--animate > * { transition: opacity var(--motion-duration-short-2) var(--motion-soft-exit); }
  .lightbox-dialog--show.lightbox-dialog--mask-fade, .lightbox-dialog--show.lightbox-dialog--mask-fade-slow { transition: background-color var(--motion-duration-medium-2) var(--motion-easing-soft-enter); }
  .lightbox-dialog--show .lightbox-dialog__window--animate, .lightbox-dialog--show .lightbox-dialog__window--fade { transition: opacity var(--motion-duration-medium-2) var(--motion-easing-soft-enter); }
  .lightbox-dialog--show .lightbox-dialog__window--animate > * { transition: opacity var(--motion-duration-medium-2) var(--motion-easing-soft-enter) var(--motion-duration-short-3); }
}

@media (max-width: 512px) {
  .lightbox-dialog--large .lightbox-dialog__window { height: 95%; max-height: 95%; width: 100%; }
  .lightbox-dialog--fullscreen .lightbox-dialog__window { border-radius: 0px; height: 100%; margin: 0px; max-height: 100%; max-width: 100%; width: 100%; }
}

@media (min-width: 512px) {
  .lightbox-dialog__window { border-radius: var(--lightbox-border-radius, var(--border-radius-100)); margin: auto; max-width: 88%; }
  .lightbox-dialog--narrow .lightbox-dialog__window { max-width: var(--dialog-lightbox-narrow-max-width); }
  .lightbox-dialog__window .lightbox-dialog__footer { flex-direction: row; justify-content: flex-end; }
  .lightbox-dialog__window .lightbox-dialog__footer > :not(:first-child) { margin-left: var(--spacing-100); margin-top: 0px; }
  .lightbox-dialog--hide-init .lightbox-dialog__window--animate, .lightbox-dialog--show .lightbox-dialog__window--animate { transform: scale(1); }
  .lightbox-dialog--hide .lightbox-dialog__window--animate, .lightbox-dialog--show-init .lightbox-dialog__window--animate { transform: scale(0.75); }
}

@media (min-width: 512px) {
  .ifh-root div[role="region"].page-notice, .ifh-root section.page-notice { margin: var(--spacing-200) 0; }
  .ifh-root .page-notice__title { margin-bottom: 2px; }
  .ifh-root p.page-notice__cta { grid-area: 1 / 4; justify-self: flex-end; margin-top: 1px; padding-right: var(--spacing-200); }
  .ifh-root .page-notice__footer { justify-self: flex-end; margin-top: 0px; }
}

@media (min-width: 512px) {
  .ifh-root div[role="region"].section-notice, .ifh-root section.section-notice { margin: var(--spacing-200) 0; }
  .ifh-root p.section-notice__cta { grid-area: 1 / 4; justify-self: flex-end; margin-top: 0px; }
  .ifh-root .section-notice__header ~ .section-notice__cta { grid-column: 3; }
  .ifh-root .section-notice__footer { padding-inline-start: var(--spacing-200); }
}
